import React, { Component,ReactNode ,View}  from 'react';
import {Flex,
    Box,
    Heading,
    Container,
    Text,
    Button,
    Stack,
    Icon,
    useColorModeValue,
    createIcon,
    SimpleGrid,
    Image,
    StackDivider,
} from '@chakra-ui/react';
import {
  IoMailOpenOutline,
  IoLogoFacebook,
  IoLogoInstagram,
  IoLaptopOutline,

} from 'react-icons/io5';
import {
  BrowserRouter as Router,
  Route,
  Switch
} from "react-router-dom";

import Head from 'next/head';
import App from "./form-page/App"
interface FeatureProps {
  text: string;
  iconBg: string;
  icon?: ReactElement;
}
const Feature = ({ text, icon, iconBg }: FeatureProps) => {
  return (
    <Stack direction={'row'} align={'center'}>
      <Flex
        w={8}
        h={8}
        align={'center'}
        justify={'center'}
        rounded={'full'}
        bg={iconBg}>
        {icon}
      </Flex>
      <Text fontWeight={600}>{text}</Text>
    </Stack>
  );
};
const Switcher = () => {
  return (
    <Router>
      <Switch>
        {console.log("reached")}
        <Route path="/app" component={App}/>
      </Switch>
    </Router>
  );
}
const Body = () => {
    return (
      <App></App>
    )
}

export default Body
